function popThat(index_,string_){
	console.log("Slice the string", string_, " at index: ", index_);
	return string_.slice(index_+1,string_.length);
}
function getFirst(s1, s2){
	let index_s1 = -1;
	let index_s2 = -1;
	for(let index1 = 0; index1 < s1.length; index1++){
		for(let index2 = 0; index2 < s2.length; index2++){
			if(s1[index1] == s2[index2]){
				index_s1 = index1;
				index_s2 = index2;
				break;
			}
		}
		if(index_s1 != -1 && index_s2 != -1){
			break;
		}
	}
	return index_s1 > index_s2 ? s2 : s1;
}
// Complete the commonChild function below.
function commonChild(s1, s2) {
	let news1 = getFirst(s1,s2);
	let news2 = news1 == s1 ? s2 : s1;
	let child = "";
	for(let index1 = 0; index1 < news1.length; index1++){
		for(let index2 = 0; index2 < news2.length; index2++){
			if(news1[index1] == news2[index2]){
				news2 = popThat(index2,news2);
				child += news1[index1];
				break;
			}
		}
		if(news2.length == 0){
			break;
		}
	}
	console.log("The child ", child);
	return child.length;
}
